import React, { useState } from "react";

const TeamCard = ({ name, phone, email, imgSrc }) => {
  const [showDetails, setShowDetails] = useState(false);

  const toggleDetails = () => {
    setShowDetails(!showDetails);
  };

  return (
    
    <div className="team-card-container">
      <div className="team-card">
        <img src={imgSrc} alt={name} className="team-card__img" />
        <div className="team-card__info" style={{ transform: "translateY(-6px)" }}>
          <h3 className="team-card__title">{name}</h3>
          <p className="team-card__number">
            <i className="fa-solid fa-phone" /> {phone}
          </p>
          <p className="team-card__gmail">
            <i className="fa-solid fa-envelope" /> {email}
          </p>
        </div>
        <div className={`team-card__arrow ${showDetails ? "rotate" : ""}`}
         onClick={toggleDetails}
          style={{ cursor: "pointer",userSelect: "none" }}>
          <i className="fa-solid fa-chevron-down" />
        </div>
      </div>

      {showDetails && (
        <div className="team-card__details">
          <div className="details-row">
            <span>
              <i className="fa-solid fa-pen-to-square" /> Edit Employee
            </span>
          </div>
          <div className="details-row">
            <span>
              <i className="fa-solid fa-trash" /> Delete Employee
            </span>
          </div>
          <div className="details-row">
            <span>
              <i className="fa-solid fa-user-slash" /> Inactivate Employee
            </span>
            <label className="switch">
              <input type="checkbox" />
              <span className="slider" />
            </label>
          </div>
        </div>
      )}
    </div>
  );
};

